core, color = factor(score >= 0)),\n","             alpha = 0.5) +\n","  scale_size_continuous(range = c(1, 10),\n","                        breaks = c(-600, -400, -200, 0, 200, 400, 600),\n","                        labels = c(\"-600\", \"-400\", \"-200\", \"0\", \"200\", \"400\", \"600\"),\n","                        name = \"Sentiment Score\") +\n","  scale_color_manual(values = c(\"red\", \"green\"),\n","                     labels = c(\"Negative\", \"Positive\"),\n","                     name = \"Sentiment\") +\n","  coord_fixed() +\n","  labs(title = \"Sentiment Score in McDonald's Locations of USA\",\n","       size = \"Sentiment Score\")\n","\n","print(McSentimentMap)"]},{"cell_type":"markdown","id":"bd9ac591","metadata":{"papermill":{"duration":0.027876,"end_time":"2023-12-26T19:53:21.573693","exception":false,"start_time":"2023-12-26T19:53:21.545817","status":"completed"},"tags":[]},"source":["# Conclusion\n","* The customers are actively speaking on the McDonald's experience as per the word cloud.\n","* The overall sentiment analysis provides a slightly positive sentiment score of 0.058.\n","* Client reviews for store 10 (1415 E State Rd, Fern Park) shows the highest positive sentiment score.\n","* Comparatively, store 14 (1650 Washington Ave, Miami Beach) shows the higest negative sentiment score.\n","* 28/40 stores are showing positive sentiment scores, which indicates good client satisfaction, while indicating room for possible improvements for those with negative scores.\n","* It is interesting to note that the negative sentiment score reported is way lower than the positive sentiment score reported on the scale."]},{"cell_type":"markdown","id":"573b7316","metadata":{"papermill":{"duration":0.029569,"end_time":"2023-12-26T19:53:21.630642","exception":false,"start_time":"2023-12-26T19:53:21.601073","status":"completed"},"tags":[]},"source":["# References\n","\n","Dataset:\n","Elgiriyewithana, N. (2023) ‘McDonald’s Store Reviews’. "]}],"metadata":{"kagg